import React from "react";
import { useState } from "react";
const Createuser=()=>{
    const [name,setName]=useState("")
    const [email,setEmail]=useState("")
    const [dept,setDept]=useState("")
    const [status,setStatus]=useState("")
    const [password,setPassword]=useState("")
    const func=()=>{
            fetch('add',{
                method:"post",
                headers: {
                    "Content-Type": "application/json",
                },
                body:JSON.stringify({
                    name:name,
                    email:email,
                    dept:dept,
                    status:status,

                })
            })
    }
    return (
        <div>
            <div className="exp_center">
        <div className="createExp">
            <div class="exp_form_title"> Create Expense</div>
            <div>
                <label>Name</label>
                <input type="number" onChange={(e)=>{setName(e.target.value)}} name="name" placeholder="0" />
                <label >Email</label>
                <input type="text" onChange={(e)=>{setEmail(e.target.value)}} name="email" placeholder="Date"/>
                <label>Department</label>
                <input type="text" name="dept" onChange={(e)=>{setDept(e.target.value)}} placeholder="Flight"/>
                <label >Status</label>
                <input type="number" name="status" onChange={(e)=>{setStatus(e.target.value)}} placeholder="0" />
                <label >Password</label>
                <input type="number" name="password" onChange={(e)=>{setPassword(e.target.value)}} placeholder="0" />

                <div onClick={func} className="login_button">Create</div>
            </div>

        </div>
        </div>
        </div>
    )
}
export default Createuser
